/*
* Training tables
*/
USE safe_explorer;

CREATE TABLE training_calendar (
	training_id VARCHAR(20) PRIMARY KEY,
    course_name VARCHAR(100),
    course_code VARCHAR(10),
    trainer_last_name VARCHAR(30),
    trainer_first_name VARCHAR(30),
    trainer_email VARCHAR(50),
    location VARCHAR(20),
    start_date DATE,
    end_date DATE,
    number_of_days INT,
    status VARCHAR(20),
    comments VARCHAR(512)
);

CREATE TABLE training_enrollment (
	enrollment_id INT PRIMARY KEY AUTO_INCREMENT,
    training_id VARCHAR(20),
    email VARCHAR(50),
    first_name VARCHAR(30),
    last_name VARCHAR(30),
    comments VARCHAR(512),
    FOREIGN KEY (training_id) REFERENCES training_calendar(training_id)
);


